INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (2, 0, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", "リリ", 125801, 1, 24001, 1, 321, 1, 40011);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (2, 0, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", "クリア", 126001, 2, 24001, 1, 322, 1, 40011);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (2, 0, "んーと。\nこれ、あげる。\nはい", "プレシア", 126101, 3, 24001, 1, 323, 1, 40011);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (2, 0, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", "リリ", 125801, 4, 24001, 2, 324, 1, 40011);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (2, 0, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", "クリア", 126001, 5, 24001, 2, 325, 1, 40011);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (2, 0, "お兄。\nきてくれて、うれしい", "プレシア", 126101, 6, 24001, 2, 326, 1, 40011);
